import React from 'react';
import { Calendar, DollarSign, PieChart, TrendingUp, TrendingDown } from 'lucide-react';
import TransactionTypeBadge from './TransactionTypeBadge';

const UnitsRow = ({ unit, index, formatCurrency, formatDate, formatPercentage }) => {
  const isSold = unit.isSold || false;
  const transactionType = unit.TransactionType || unit.transactionType || 'BUY'; // Handle case variations
  const isSellTransaction = transactionType === 'SELL';
  const isBuyTransaction = transactionType === 'BUY';

  // Determine row styling
  const getRowStyles = () => {
    if (isSellTransaction) {
      return {
        container: 'bg-gradient-to-r from-red-50 to-red-100 border-l-4 border-red-500 hover:from-red-100 hover:to-red-200',
        text: 'text-red-800',
        accent: 'text-red-600'
      };
    } else if (isSold) {
      return {
        container: 'bg-gradient-to-r from-gray-50 to-gray-100 border-l-4 border-gray-400 hover:from-gray-100 hover:to-gray-200',
        text: 'text-gray-700',
        accent: 'text-gray-600'
      };
    } else {
      return {
        container: 'bg-gradient-to-r from-green-50 to-green-100 border-l-4 border-green-500 hover:from-green-100 hover:to-green-200',
        text: 'text-green-800',
        accent: 'text-green-600'
      };
    }
  };

  const styles = getRowStyles();

  return (
    <tr className={`${styles.container} transition-all duration-300 hover:shadow-md group`}>
      {/* Date Column */}
      <td className="px-6 py-4 whitespace-nowrap">
        <div className="flex items-center space-x-2">
          <Calendar className={`h-4 w-4 ${styles.accent}`} />
          <span className={`text-sm font-medium ${styles.text}`}>
            {formatDate(unit.date) === 'Invalid Date' ? (
              <span className="text-red-500 font-bold">Invalid Date</span>
            ) : (
              formatDate(unit.date)
            )}
          </span>
        </div>
      </td>

      {/* Transaction Type Column */}
      <td className="px-6 py-4 whitespace-nowrap">
        <div className="flex justify-center">
          <TransactionTypeBadge 
            transactionType={transactionType} 
            isSold={isSold}
            className="transform group-hover:scale-110 transition-transform duration-200"
          />
        </div>
      </td>

      {/* Amount Column */}
      <td className="px-6 py-4 whitespace-nowrap">
        <div className="flex items-center space-x-2">
          <DollarSign className={`h-4 w-4 ${styles.accent}`} />
          <span className={`text-sm font-semibold ${styles.text}`}>
            {formatCurrency(unit.amount)}
          </span>
        </div>
      </td>

      {/* Units Column */}
      <td className="px-6 py-4 whitespace-nowrap">
        <div className="flex items-center space-x-2">
          <PieChart className={`h-4 w-4 ${styles.accent}`} />
          <span className={`text-sm font-semibold ${styles.text}`}>
            {unit.units != null ? unit.units.toFixed(4) : '0.0000'}
          </span>
        </div>
      </td>

      {/* Sell Date Column */}
      <td className="px-6 py-4 whitespace-nowrap">
        <div className="flex items-center space-x-2">
          {unit.sellDate ? (
            <>
              <Calendar className={`h-4 w-4 ${styles.accent}`} />
              <span className={`text-sm ${styles.text}`}>
                {formatDate(unit.sellDate)}
              </span>
            </>
          ) : (
            <span className="text-gray-400 text-sm">-</span>
          )}
        </div>
      </td>

      {/* Profit/Loss Column */}
      <td className="px-6 py-4 whitespace-nowrap">
        <div className="flex items-center space-x-2">
          {(unit.profitLoss || 0) >= 0 ? (
            <TrendingUp className="h-4 w-4 text-green-500" />
          ) : (
            <TrendingDown className="h-4 w-4 text-red-500" />
          )}
          <span className={`text-sm font-semibold ${
            (unit.profitLoss || 0) >= 0 ? 'text-green-600' : 'text-red-600'
          }`}>
            {formatCurrency(unit.profitLoss)}
          </span>
        </div>
      </td>

      {/* Profit/Loss Percentage Column */}
      <td className="px-6 py-4 whitespace-nowrap">
        <div className="flex items-center space-x-2">
          <span className={`text-sm font-semibold ${
            (unit.profitLossPercent || 0) >= 0 ? 'text-green-600' : 'text-red-600'
          }`}>
            {formatPercentage(unit.profitLossPercent)}
          </span>
          {(unit.profitLossPercent || 0) >= 0 ? (
            <div className="w-2 h-2 bg-green-500 rounded-full animate-pulse"></div>
          ) : (
            <div className="w-2 h-2 bg-red-500 rounded-full animate-pulse"></div>
          )}
        </div>
      </td>
    </tr>
  );
};

export default UnitsRow;
